import { StyleSheet } from 'react-native';

export default StyleSheet.create(
    {
        card: {
            display: 'flex',
            flexDirection: 'row',
            margin: 10,
            alignItems: 'center', 
            borderWidth: 1,
            borderColor: '#000',
            backgroundColor: '#fff'
        },
        img:{
            width: 50,
            height: 50,
            marginRight: 10,
        },
        instagram:[
            'rgb(106, 57, 171)',
            'rgb(151, 52, 160)',
            'rgb(197, 57, 92)',
            'rgb(231, 166, 73)',
            'rgb(181, 70, 92)'
        ]
    }
);
